import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="App">
          <h2>React File Upload Demo</h2>
        </div>
      </div>
    </div>
  );
}

export default App;
